import React from 'react';
import './RiskChart.css';

function RiskChart() {
  // In a real application, you would use a charting library like Chart.js or Recharts
  // This is a placeholder for the chart
  return (
    <div className="risk-chart">
      <img src="/chart-placeholder.png" alt="Risk trend chart" className="chart-image" />
    </div>
  );
}

export default RiskChart;
